import { Navbar, Nav, NavDropdown } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import LogInLink from './LogInLink';
import LogOutLink from './LogOutLink';
import authServices from '../../store/services/authServices';

const Navbarpage = () => {
    console.log(authServices().username)
    return (
        <div className='navClass'>
            <Navbar expand="lg">
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse>                    
                    <Nav className="mr-auto">
                        <Nav.Link as={Link} to="/home">Home</Nav.Link>       
                        <NavDropdown title="Items">
                            <NavDropdown.Item as={Link} to="/">Item 1</NavDropdown.Item>
                            <NavDropdown.Item as={Link} to="/">Item 2</NavDropdown.Item>
                            <NavDropdown.Item as={Link} to="/">Item 3</NavDropdown.Item>                       
                        </NavDropdown>
                                                
                    </Nav>  
                    <Nav>
                        {(authServices().username === undefined)?(<LogOutLink />):(<LogInLink />)}                                
                    </Nav>                  
                </Navbar.Collapse>
            </Navbar>            
        </div>        
    )
}

export default Navbarpage;
